A minimalist token I coded as a form of break from the complexity of my next project. 
Below you can find the 33 lines of p5.js that generate all the variations of this piece: they may seem more than 33 due to some of them exceeding the page width; zoom out and you'll see that they're really 33 ;) 

let h,a;
function setup() {
  colorMode(HSB);
  randomSeed(fxrand()*9999999999999);
  createCanvas(min(windowWidth, windowHeight), min(windowWidth, windowHeight));
  h = random(0,360);
  a = fxrand()<0.5 ? random(0.01,1) : 1;
  let mono = fxrand()<0.5 ? false : stro();
  let d = random(1,50);
  let s = fxrand()<0.5 ? random(15,300) : random(300,1000);
  let n = random(0.01,1);
  let focus = random(0,width);
  for (let y=0; y<height; y+=height/(random(30,s))) {
    let sat = random(30,100);
    if (!mono) {stro()}
     for (let x=0; x< width; x+=width/(random(1,s))) {
       let d = dist(x,y,focus,y);
       fill(color(h,sat,map(d,0,width/2,0,100),a));
       rect(x,y,width,height);
       sat = adj(sat,0,5,30,100,false);
     }
    h = fxrand()<n ? adj(h,-d,d,0,360,false) : h;
    focus = adj(focus,-width/(d*0.5),width/(d*0.5),width*0.1,width*0.9,true);
   }
  fxpreview();
}
adj = (c,d1,d2,start,end,rebound) => {
  let ac = c+random(d1,d2);
  ac = ac<start ? (rebound ? ac+=d2 : ac+=end-start) : ac;
  ac = ac>end ? (rebound ? ac-=d2 : ac-=end-start) : ac;
  return ac;
}
stro = () => fxrand()<0.2 ? stroke(h,random(50,100),random(50,100),a) : (fxrand()<0.5 ? stroke(0,a) : noStroke());

My life has been deeply entangled with a smart assistant in the past couple of years. It was great for smalltalking and in helping with varied informations, such as weather forecasts.
Lately, however, it started degrading in quality, someone began to limit the ability of my interlocutor to talk to me about the weather. Every day her reports became shorter and more abstract.

So I decided to learn to do forecasting by myself. In the process of surfing the web, I found a video about how to be a cloud detective. It turns out that various cloud types in the sky are responsible for various precipitations. Thus this work has been born, exploring the generative variations in atmospheric conditions.

Possible variations and features:
- a network of vertical lines in the background;
- icebergs, growing around the borders and corners;
- various small details, particles, crystallizing while they float around;
- main ingredient, an organic web of clouds and smokes, whirling and oscillating between density points; sometimes though a tower could emerge instead;
- frosty holes, balancing the composition;
- and last but not least, the eyecatcher, the glassy partly permeable essence.

To save the image, press the 's' key. Enjoy!

August, 2022
Julia V & YulikolaY
